import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom'
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import logo1 from '../assets/logo1.jpg'
import trainService from '../services/train.service';

const Header = () => {


  const [train,setTrain]=useState([]);

  const getByTrainName=(id)=> {
    console.log(id);
    trainService.getByName(id).then((response)=> {
      console.log("All Data",response.data);
      setTrain(response.data);
    }).catch((error)=> {
      console.log("Something went wrong",error);
    });
  }

  useEffect(()=> {
    getByTrainName();
  },[]);

  return (
    <header className='header'>

      <div>
      <img
          src={logo1}
          alt=""
          style={{
             height: "26px",
             width: "66px",
             paddingRight: "20px",


          }}
        />
      </div>
      {/* <div>
        <Link className='links' to='/'>
          Home
        </Link>
      </div> */}

      <nav className='navbar' style={{height:"40px"}}>
        <ul>
        <Link className='links' to='/'>
          Home
        </Link>
          <Link className='links' to='/login'>
            Login
          </Link>
          <Link className='links' to='/signup'>
            Sign Up
          </Link>
          <Link className='links' to='/Contact'>
            Contact Us
          </Link>
          <Link className='links' to='/Train'>
           All trains
          </Link>
        </ul>
      </nav>
      <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
              style={{marginLeft: "480px",height:"30px",width:"290px"}}
            />
            <Button id="search" variant="secondary" style={{marginRight: "30px"}} 
            onClick={(trs)}>
              Search
            </Button>
      </Form>
    </header>
  )
}

export default Header
